import React from 'react';
import HEAD from './CODE/HEAD/HEAD.js'
import CONTENT from './CODE/CONTENT/CONTENT.js'
import FOOTER from './CODE/FOOTER/FOOTER'
import s from './App.module.css'

import { BrowserRouter } from 'react-router-dom';
import ss from './order_Shop/order_Shop.module.css'

function App() {
  let Ord_Shoop = [
    { class: ss.nav1, path: "Buy_subscription", name: "Заказ" },
    { class: ss.nav2, path: "test2", name: "БД" },
    { class: ss.nav3, path: "kk", name: "КК" },
    { class: ss.nav4, path: "ord", name: "Оформление" },
    { class: ss.nav5, path: "kontakt", name: "Контакты" },
    { class: ss.nav6, path: "time_work", name: "Время работы" },
    { class: ss.nav7, path: "books", name: "Буквы" },
]
  return (
    <BrowserRouter>
      <div className={s.wrapper}>
        <HEAD />
        <CONTENT  Ord_Shoop={Ord_Shoop}/>
        <FOOTER />
      </div>
    </BrowserRouter>
  );
}

export default App;
